def min_operations(n, boxes):

    def Max(a, b, c):
        if a > b:
            if a > c:
                return a
            else:
                return c
        elif b > c:
            return b
        else:
            return c
    (tr, tb, tg) = (0, 0, 0)
    for i in range(n):
        if boxes[i][0] > 0:
            tr = 1
        if boxes[i][1] > 0:
            tg = 1
        if boxes[i][2] > 0:
            tb = 1
    if tr + tg + tb >= n:
        return -1
    Moves = 0
    for i in range(n):
        Moves = Moves + boxes[i][0] + boxes[i][1] + boxes[i][2] - Max(boxes[i][0], boxes[i][1], boxes[i][2])
    return Moves

